import React from 'react'
import Banner from "../components/Banner";
import Contact from '../sections/Contact';
import Map from '../sections/Map';
function ContactUs() {
    return (
        <>
   
      <Banner heading = "Contact Us" l1 ="contactUs"/>
      <Contact/>
      <Map />
     
    
       </>
    )
}

export default ContactUs
